import { Box, Container, Stack } from "@mui/material";

//import { styled } from '@mui/system';
import useMediaQuery from "../hooks/useMediaQuery";
import { Images } from "../Constants/images";
//import { motion } from "framer-motion";
import { Typewriter } from "react-simple-typewriter";
const Header = () => {
  const Media = useMediaQuery("(min-width:1070px)");
  return (
    <div style={{ width: "100%", height: `${Media ? "100vh" : "100%"}` }}>
      <Box
        className="ml-[5%] w-[100%] h-[100%] flex justify-center items-center"
        width={`${Media ? "90%" : "90%"}`}
      >
        <Stack
          direction={`${Media ? "row" : "column"}`}
          spacing={4}
          width={`${Media ? "100%" : "100%"}`}
          height={`${Media ? "75%" : "80%"}`}
          display={"flex"}
          justifyContent={"space-between"}
          style={{
            //backgroundColor: "black",
            padding: `${Media ? "50px" : "20px"}`,
          }}
        >
          <Stack
            width={`${Media ? "600px" : "100%"}`}
            
            className="rounded-2xl"
            height={`${Media ? "100%" : "70% "}`}
            maxHeight={`${Media ? "100%" : "600px"}`}
          >
            <div className="w-[100%] m-[30px] text-black">
              <h1 className=" text-5xl text-secondarycolor">
                {" "}
                <span className="font-google text-yellow-400">
                  Flash
                </span>{" "}
                Rooms
              </h1>
            </div>
            <div>
              <Stack margin={"20px"}>
                {/* <img src={Images.Quots}/> */}
                <div>
                  <span className="text-3xl text-primarycolors font-google font-bold">
                  <Typewriter
                        
                          words={[
                            "The gateway to your world ",
                            "Connecting hearts through writing",
                            "Your stories, safely stored.",
                            "Messages of love",
                          ]}
                          loop={Infinity}
                          cursor
                          cursorStyle="$"
                          typeSpeed={100}
                          deleteSpeed={50}
                          delaySpeed={1000}
                        />
                  </span>
                </div>
                <div></div>
              </Stack>
            </div>
          </Stack>
          <Stack
            width={`${Media ? "900px" : "100%"}`}
            style={{ backgroundColor: "" }}
            className="p-[10px]"
            height={`${Media ? "100% " : "80% "}`}
          >
            <h1 className="text-white">hello</h1>
            <Stack direction={"column"} width={""}></Stack>
            <div>
              <h1 className="text-3xl as">Test</h1>
              <img src={Images.House} alt="Houes" />
            </div>
          </Stack>
        </Stack>
      </Box>
    </div>
  );
};

export default Header;
